import React, { useState } from 'react';
import { predictFibromyalgia } from '../api/fibromyalgia';

function PatientDashboard() {
  const [form, setForm] = useState({
    age: '',
    sex: '',
    ses: '',
    csi: '',
    sps: '',
    sat: ''
  });
  const [result, setResult] = useState(null);
  const [probability, setProbability] = useState(null);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setResult(null);
    setProbability(null);
    setLoading(true);
    try {
      // Convert fields to numbers
      const inputData = {
        age: parseFloat(form.age),
        sex: parseInt(form.sex),
        ses: parseFloat(form.ses),
        csi: parseFloat(form.csi),
        sps: parseFloat(form.sps),
        sat: parseFloat(form.sat)
      };
      const token = localStorage.getItem('token');
      const res = await predictFibromyalgia(inputData, token);
      setResult(res.data.risk);
      setProbability(res.data.probability);
    } catch (err) {
      setError(err.response?.data?.detail || 'Prediction failed.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div>
      <h2>Patient Dashboard</h2>
      <form onSubmit={handleSubmit} style={{ maxWidth: 400, margin: '1em auto' }}>
        <div>
          <label>Age: <input type="number" name="age" value={form.age} onChange={handleChange} required /></label>
        </div>
        <div>
          <label>Sex (0=Female, 1=Male): <input type="number" name="sex" value={form.sex} onChange={handleChange} required min="0" max="1" /></label>
        </div>
        <div>
          <label>SES: <input type="number" name="ses" value={form.ses} onChange={handleChange} required step="any" /></label>
        </div>
        <div>
          <label>CSI: <input type="number" name="csi" value={form.csi} onChange={handleChange} required step="any" /></label>
        </div>
        <div>
          <label>SPS: <input type="number" name="sps" value={form.sps} onChange={handleChange} required step="any" /></label>
        </div>
        <div>
          <label>SAT: <input type="number" name="sat" value={form.sat} onChange={handleChange} required step="any" /></label>
        </div>
        <button type="submit" disabled={loading}>{loading ? 'Predicting...' : 'Predict Fibromyalgia Risk'}</button>
      </form>
      {error && <div style={{ color: 'red' }}>{error}</div>}
      {result && (
        <div style={{ marginTop: '1em' }}>
          <strong>Risk Level:</strong> {result}<br />
          <strong>Probability:</strong> {probability}%
        </div>
      )}
    </div>
  );
}

export default PatientDashboard;
